import { Container } from "react-bootstrap";
import Plants from "./Plants/Plants";

function Waterfold(){
    return(
        <div>
            <Container fluid>
                <div style={{backgroundColor: '#f9f6f0', padding: '40px 20px'}}>
                    <Plants></Plants>
                </div>
            </Container>
        </div>
    )
}

export default Waterfold
